import './quantitypicker.css';


const QuantityPicker = () => {
    const [quantity, setQuantit] = useState(1);

    const increase =() => {
        console.log("btn clicked");
    }


    return(
        <div className="qt-picker">
            <button onClick={increase}>+</button>
            <label>1</label>
            <button>-</button>
            
        </div>
    );
}

export default QuantityPicker;
